package com.daengdaeng.domain.pet.domain;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.Table;import lombok.AccessLevel;import lombok.Builder;import lombok.Getter;import lombok.NoArgsConstructor;@NoArgsConstructor(access = AccessLevel.PROTECTED)@Getter@Entity@Table(name = "mbti")public class Mbti {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	@Column(name = "mbti_id")	private int mbtiId;	@Column(name = "mbti", nullable = false)	private String mbti;	@Column(name = "content", nullable = false)	private String content;	@Builder	public Mbti(int mbtiId, String mbti, String content) {		this.mbtiId = mbtiId;		this.mbti = mbti;		this.content = content;	}}